import React from 'react';
import { Link } from 'react-router-dom';
import imgSrc from "./Restraunt__photo.jpg";

const Homepage = () => {
  return (
    <div className='homepage-container'>
      <div className='name-rest'>
        <h1>The Happy Place</h1>
      </div>
      <nav className="navbar">
        <div className="btn-group">
          <Link to="/menu" className="btn-group__item">
            Menu
          </Link>
          <Link to="/login" className="btn-group__item">
            Reservation
          </Link>
        </div>
      </nav>
      <div className='itemphoto'>
        <img src={imgSrc} alt='Restaurant' className='photophoto' />
      </div>
    </div>
  );
}

export default Homepage;
